　ネコ磁石 マグネット すわる まつ とまる せのび ねがえり  アルタ 8.5×7×1cm ギフト雑貨 猫通販 <!--商品説明--><div style="width:100%; text-align:left;"><img style="margin:0px 0 10px 0;width:100% ;border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/bn/itembn-1.gif" alt="アート＆雑貨のお店ベルコモン/商品説明"><div style="width:90%; padding:0px 15px; background-color:#FFF; text-align:left; color:#524e4d;"><!--キャッチ--><h4 style="color:#7b7c7d;">書類 整理 収納 クリップ 文具 文房具 おしゃれ 雑貨<br><br></h4><!--ココまで--><!--商品詳細-->大人気の《猫》グッズにまたまた新しいグッズが新登場☆彡<br>こちらは冷蔵庫などにあると便利な【マグネット磁石】<br>全5種類のバリエーションで、それぞれ「すわる」「まつ」「とまる」「せのび」「ねがえり」といろんな姿勢が楽しめます。<br>集めてより可愛く、オシャレに使ってね♪<br>■サイズ:約85×70×10mm<!--ココまで--><br><br><!--キーワード-->▼ <!--ココまで--></div></div><br><br><!--詳細画像--><div style="width:100%; background-color:#FFF; text-align:left;"><img style="margin:5px 0 10px 0;width:100% ;border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/bn/itembn-2.gif" alt="アート＆雑貨のお店ベルコモン/詳細画像"><div style="width:90%;text-align:center;"><IMG style="width:230; height:230; border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/r20160802/art-ar0810079-83.jpg"> <IMG style="width:230; height:230; border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/r20160802/art-ar0810079-83_2.jpg"> <IMG style="width:230; height:230; border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/r20160802/art-ar0810079-83_3.jpg"> <IMG style="width:230; height:230; border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/r20160802/art-ar0810079-83_4.jpg"> <IMG style="width:230; height:230; border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/r20160802/art-ar0810079-83_5.jpg"> <IMG style="width:230; height:230; border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/r20160802/art-ar0810079-83_6.jpg"> <IMG style="width:230; height:230; border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/r20160802/art-ar0810079-83_7.jpg"> <IMG style="width:230; height:230; border:none;" src="http://image.rakuten.co.jp/velkommen/cabinet/r20160802/art